class Solution {
    func numberOfBeautifulIntegers(_ low: Int, _ high: Int, _ k: Int) -> Int {
        var count = 0
        for number in low...high {
            if number % k == 0 && isBeautiful(number) {
                count += 1
            }
        }
        return count
    }

    private func isBeautiful(_ number: Int) -> Bool {
        var num = number
        var evenCount = 0
        var oddCount = 0
        while num > 0 {
            let digit = num % 10
            if digit % 2 == 0 {
                evenCount += 1
            } else {
                oddCount += 1
            }
            num /= 10
        }
        return evenCount == oddCount
    }
}
